import React from 'react';
import "./Card.css";
import {Link} from "react-router-dom";
// import 'tachyons'; 	
	

const Card = () => {
	return (
		<div>
			<br></br><br></br><br></br>
			<div className="grid-layout"> {/*taken from https://stackoverflow.com/questions/8470070/how-to-create-grid-tile-view*/}
				<Link to ="/order"><button className="item grow span-3"><h1 className="mera">Order Management</h1></button></Link>
				<button className="item grow span-3" ><h1 className="mera">Inventory Management</h1></button>
				<button className="item grow span-3"><h1 className="mera">Finances</h1></button>
				<button className="item grow span-3"><h1 className="mera">Menu</h1></button>
				<button className="item grow span-3"><h1 className="mera">Customer Database</h1></button>
				<button className="item grow span-3"><h1 className="mera">Loyalty Scheme</h1></button>
				<button className="item grow span-3"><h1 className="mera">Customer Support</h1></button>
				<button className="item grow span-3"><h1 className="mera">Restaurant Details</h1></button>




		{/*ISKE NEECHE BULLSHIT*/}

			</div>
		 	   
		</div>
	);
}
	

export default Card;



